import React from 'react';
import { Popup, POPUP_ALIGN } from '@6d-ui/popup';
import AddScheduleToMaterial from './AddScheduleToMaterial';
import AddParticipant from './AddParticipant';
import AddMaterialModel from './AddMaterial';
export default function RenderModal(props) {
  const { onAccessChange, material, getMaterialList, closeAddMaterialPopup, addMaterialModel, url_Booklet, ajaxUtil, loadingFunction, setNotification, addScheduleModal, closeAddScheduleModal, onCreateSchedule, updateScheduleDateRange, addParticipantModel, closeAddParticipantModel, openAddParticipantModel } = props;

  if (addScheduleModal) {
    return (
      <Popup
        type={POPUP_ALIGN.RIGHT}
        title="Schedule Material"
        isOpen={addScheduleModal}
        close={closeAddScheduleModal}
        minWidth="50%"
        component={
          <AddScheduleToMaterial
            onCreateSchedule={onCreateSchedule}
            onAccessChange={onAccessChange}
            updateScheduleDateRange={updateScheduleDateRange}
            closeAddScheduleModal={closeAddScheduleModal} />
        }
      />
    )
  }
  if (addParticipantModel) {
    return (
      <Popup
        type={POPUP_ALIGN.RIGHT}
        title="Add Participants"
        isOpen={addParticipantModel}
        close={closeAddParticipantModel}
        minWidth="70%"
        component={
          <AddParticipant
            closeAddParticipantModel={closeAddParticipantModel}
            material={material}
            getMaterialList={getMaterialList}
            ajaxUtil={ajaxUtil}
            loadingFunction={loadingFunction}
            setNotification={setNotification}
            url_Booklet={url_Booklet}
          />
        }
      />
    )
  }

  if (addMaterialModel) {
    return (
      <Popup
        type={POPUP_ALIGN.RIGHT}
        title="Add Material"
        isOpen={addMaterialModel}
        close={closeAddMaterialPopup}
        minWidth="70%"
        component={
          <AddMaterialModel
            getMaterialList={getMaterialList}
            closeAddMaterialPopup={closeAddMaterialPopup}
            ajaxUtil={ajaxUtil}
            loadingFunction={loadingFunction}
            setNotification={setNotification}
            url_Booklet={url_Booklet}
          />
        }
      />
    )
  }
  return (<></>)

}
